import styled from '@emotion/styled'

export const General = styled.div`
  height: 6;
  background-color: hotpink;
  color: white;
  font-family: 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;
  font-size: 24px;
  padding: 10px;
  margin: 5px;
`
